import { useEffect, useState } from 'react'
import Post from '~/components/Post';

function Home() {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        fetch('https://moonlit-poetry-438713-c2.uc.r.appspot.com/posts?page=0&size=5&content&language')
            .then(res => res.json())
            .then(res => {
                console.log(res.content)
                setPosts(res.content)
            })
            .finally(() => {
                console.log(posts)
            })
    }, [])

    const renderPosts = () => {
        posts.map((post, index) => (
            <Post data={post} key={index} />
        ))
    }

    return (
        <>

        </>
    );
}

export default Home;
